"use strict";(self.webpackChunk=self.webpackChunk||[]).push([["3950"],{2474:function(s,n,t){t.r(n),t.d(n,{default:function(){return d}});var a=t(1147);let e=["innerHTML"],d={setup:()=>({html:""}),render:()=>((0,a.wg)(),(0,a.iD)("div",{class:"mi-doc-markdown-body",innerHTML:'<h1>ShareSheet 分享面板</h1>\n<div class="mi-doc-card"><h3 id="jie-shao" tabindex="-1">介绍</h3>\n<p>底部弹起的分享面板，用于展示各分享渠道对应的操作按钮，不含具体的分享逻辑。</p>\n</div><div class="mi-doc-card"><h3 id="yin-ru" tabindex="-1">引入</h3>\n<p>通过以下方式来全局注册组件，更多注册方式请参考<a href="#/zh-CN/advanced-usage#zu-jian-zhu-ce" target="_blank">组件注册</a>。</p>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { createApp } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n<span class="hljs-keyword">import</span> { <span class="hljs-title class_">ShareSheet</span> } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n\n<span class="hljs-keyword">const</span> app = <span class="hljs-title function_">createApp</span>();\napp.<span class="hljs-title function_">use</span>(<span class="hljs-title class_">ShareSheet</span>);\n</code></pre>\n</div><h2 id="dai-ma-yan-shi" tabindex="-1">代码演示</h2>\n<div class="mi-doc-card"><h3 id="ji-chu-yong-fa" tabindex="-1">基础用法</h3>\n<p>分享面板通过 <code>options</code> 属性来定义分享选项，数组的每一项是一个对象，对象格式见文档下方表格。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-cell</span> <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;显示分享面板&quot;</span> @<span class="hljs-attr">click</span>=<span class="hljs-string">&quot;showShare = true&quot;</span> /&gt;</span>\n<span class="hljs-tag">&lt;<span class="hljs-name">mi-share-sheet</span>\n    <span class="hljs-attr">v-model:show</span>=<span class="hljs-string">&quot;showShare&quot;</span>\n    <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;立即分享给好友&quot;</span>\n    <span class="hljs-attr">:options</span>=<span class="hljs-string">&quot;options&quot;</span>\n    @<span class="hljs-attr">select</span>=<span class="hljs-string">&quot;onSelect&quot;</span>\n/&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n<span class="hljs-keyword">import</span> { showToast } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> showShare = <span class="hljs-title function_">ref</span>(<span class="hljs-literal">false</span>);\n        <span class="hljs-keyword">const</span> options = [\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;微信&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;wechat&#x27;</span> },\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;微博&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;weibo&#x27;</span> },\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;复制链接&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;link&#x27;</span> },\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;分享海报&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;poster&#x27;</span> },\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;二维码&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;qrcode&#x27;</span> },\n        ];\n\n        <span class="hljs-keyword">const</span> <span class="hljs-title function_">onSelect</span> = (<span class="hljs-params">option</span>) =&gt; {\n            <span class="hljs-title function_">showToast</span>(option.<span class="hljs-property">name</span>);\n            showShare.<span class="hljs-property">value</span> = <span class="hljs-literal">false</span>;\n        };\n\n        <span class="hljs-keyword">return</span> {\n            options,\n            onSelect,\n            showShare,\n        };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="zhan-shi-duo-xing-xuan-xiang" tabindex="-1">展示多行选项</h3>\n<p>当分享选项的数量较多时，可以将 <code>options</code> 定义为数组嵌套的格式，每个子数组会作为一行选项展示。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-share-sheet</span>\n    <span class="hljs-attr">v-model:show</span>=<span class="hljs-string">&quot;showShare&quot;</span>\n    <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;立即分享给好友&quot;</span>\n    <span class="hljs-attr">:options</span>=<span class="hljs-string">&quot;options&quot;</span>\n/&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> showShare = <span class="hljs-title function_">ref</span>(<span class="hljs-literal">false</span>);\n        <span class="hljs-keyword">const</span> options = [\n            [\n                { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;微信&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;wechat&#x27;</span> },\n                { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;朋友圈&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;wechat-moments&#x27;</span> },\n                { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;微博&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;weibo&#x27;</span> },\n                { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;QQ&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;qq&#x27;</span> },\n            ],\n            [\n                { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;复制链接&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;link&#x27;</span> },\n                { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;分享海报&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;poster&#x27;</span> },\n                { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;二维码&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;qrcode&#x27;</span> },\n                { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;小程序码&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;weapp-qrcode&#x27;</span> },\n            ],\n        ];\n\n        <span class="hljs-keyword">return</span> {\n            options,\n            showShare,\n        };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="zi-ding-yi-tu-biao" tabindex="-1">自定义图标</h3>\n<p>除了使用内置的几种图标外，可以直接在 <code>icon</code> 中传入图片 URL 来使用自定义的图标。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-share-sheet</span> <span class="hljs-attr">v-model:show</span>=<span class="hljs-string">&quot;showShare&quot;</span> <span class="hljs-attr">:options</span>=<span class="hljs-string">&quot;options&quot;</span> /&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> showShare = <span class="hljs-title function_">ref</span>(<span class="hljs-literal">false</span>);\n        <span class="hljs-keyword">const</span> options = [\n            {\n                <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;名称&#x27;</span>,\n                <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;https://cdn.jsdelivr.net/gh/wuxingxi888/CDN_IMG_BED/custom-icon-fire.png&#x27;</span>,\n            },\n            {\n                <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;名称&#x27;</span>,\n                <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;https://cdn.jsdelivr.net/gh/wuxingxi888/CDN_IMG_BED/custom-icon-light.png&#x27;</span>,\n            },\n            {\n                <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;名称&#x27;</span>,\n                <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;https://cdn.jsdelivr.net/gh/wuxingxi888/CDN_IMG_BED/custom-icon-water.png&#x27;</span>,\n            },\n        ];\n\n        <span class="hljs-keyword">return</span> {\n            options,\n            showShare,\n        };\n    },\n};\n</code></pre>\n</div><div class="mi-doc-card"><h3 id="zhan-shi-miao-shu-xin-xi" tabindex="-1">展示描述信息</h3>\n<p>通过 <code>description</code> 属性可以设置标题下方的描述文字, 在 <code>options</code> 内设置 <code>description</code> 属性可以添加分享选项描述。</p>\n<pre><code class="language-html"><span class="hljs-tag">&lt;<span class="hljs-name">mi-share-sheet</span>\n    <span class="hljs-attr">v-model:show</span>=<span class="hljs-string">&quot;showShare&quot;</span>\n    <span class="hljs-attr">:options</span>=<span class="hljs-string">&quot;options&quot;</span>\n    <span class="hljs-attr">title</span>=<span class="hljs-string">&quot;立即分享给好友&quot;</span>\n    <span class="hljs-attr">description</span>=<span class="hljs-string">&quot;描述信息&quot;</span>\n/&gt;</span>\n</code></pre>\n<pre><code class="language-js"><span class="hljs-keyword">import</span> { ref } <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;vue&#x27;</span>;\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n    <span class="hljs-title function_">setup</span>(<span class="hljs-params"></span>) {\n        <span class="hljs-keyword">const</span> showShare = <span class="hljs-title function_">ref</span>(<span class="hljs-literal">false</span>);\n        <span class="hljs-keyword">const</span> options = [\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;微信&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;wechat&#x27;</span> },\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;微博&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;weibo&#x27;</span> },\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;复制链接&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;link&#x27;</span>, <span class="hljs-attr">description</span>: <span class="hljs-string">&#x27;描述信息&#x27;</span> },\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;分享海报&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;poster&#x27;</span> },\n            { <span class="hljs-attr">name</span>: <span class="hljs-string">&#x27;二维码&#x27;</span>, <span class="hljs-attr">icon</span>: <span class="hljs-string">&#x27;qrcode&#x27;</span> },\n        ];\n\n        <span class="hljs-keyword">return</span> {\n            options,\n            showShare,\n        };\n    },\n};\n</code></pre>\n</div><h2 id="api" tabindex="-1">API</h2>\n<div class="mi-doc-card"><h3 id="props" tabindex="-1">Props</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>v-model:show</td>\n<td>是否显示分享面板</td>\n<td><em>boolean</em></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>options</td>\n<td>分享选项</td>\n<td><em>Option[]</em></td>\n<td><code>[]</code></td>\n</tr>\n<tr>\n<td>title</td>\n<td>顶部标题</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>cancel-text</td>\n<td>取消按钮文字，传入空字符串可以隐藏按钮</td>\n<td><em>string</em></td>\n<td><code>\'取消\'</code></td>\n</tr>\n<tr>\n<td>description</td>\n<td>标题下方的辅助描述文字</td>\n<td><em>string</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>duration</td>\n<td>动画时长，单位秒，设置为 0 可以禁用动画</td>\n<td><em>number | string</em></td>\n<td><code>0.3</code></td>\n</tr>\n<tr>\n<td>z-index</td>\n<td>将面板的 z-index 层级设置为一个固定值</td>\n<td><em>number | string</em></td>\n<td><code>2000+</code></td>\n</tr>\n<tr>\n<td>round</td>\n<td>是否显示圆角</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>overlay</td>\n<td>是否显示遮罩层</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>overlay-class</td>\n<td>自定义遮罩层类名</td>\n<td><em>string | Array | object</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>overlay-style</td>\n<td>自定义遮罩层样式</td>\n<td><em>object</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>lock-scroll</td>\n<td>是否锁定背景滚动</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>lazy-render</td>\n<td>是否在显示弹层时才渲染内容</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>close-on-popstate</td>\n<td>是否在页面回退时自动关闭</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>close-on-click-overlay</td>\n<td>是否在点击遮罩层后关闭</td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>safe-area-inset-bottom</td>\n<td>是否开启<a href="#/zh-CN/advanced-usage#di-bu-an-quan-qu-gua-pei" target="_blank">底部安全区适配</a></td>\n<td><em>boolean</em></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>teleport</td>\n<td>指定挂载的节点，等同于 Teleport 组件的 <a href="https://cn.vuejs.org/api/built-in-components.html#teleport" target="_blank">to 属性</a></td>\n<td><em>string | Element</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>before-close</td>\n<td>关闭前的回调函数，返回 <code>false</code> 可阻止关闭，支持返回 Promise</td>\n<td><em>(action: string) =&gt; boolean | Promise&lt;boolean&gt;</em></td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="option-shu-ju-jie-gou" tabindex="-1">Option 数据结构</h3>\n<p><code>options</code> 属性为一个对象数组，数组中的每个对象配置一列，对象可以包含以下值：</p>\n<table>\n<thead>\n<tr>\n<th>键名</th>\n<th>说明</th>\n<th>类型</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>name</td>\n<td>分享渠道名称</td>\n<td><em>string</em></td>\n</tr>\n<tr>\n<td>description</td>\n<td>分享选项描述</td>\n<td><em>string</em></td>\n</tr>\n<tr>\n<td>icon</td>\n<td>图标，可选值为 <code>wechat</code> <code>weibo</code> <code>qq</code> <code>link</code> <code>qrcode</code> <code>poster</code> <code>weapp-qrcode</code> <code>wechat-moments</code>，支持传入图片 URL</td>\n<td><em>string</em></td>\n</tr>\n<tr>\n<td>className</td>\n<td>分享选项类名</td>\n<td><em>string</em></td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="events" tabindex="-1">Events</h3>\n<table>\n<thead>\n<tr>\n<th>事件名</th>\n<th>说明</th>\n<th>回调参数</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>select</td>\n<td>点击分享选项时触发</td>\n<td><em>option: Option, index: number</em></td>\n</tr>\n<tr>\n<td>cancel</td>\n<td>点击取消按钮时触发</td>\n<td>-</td>\n</tr>\n<tr>\n<td>open</td>\n<td>打开面板时触发</td>\n<td>-</td>\n</tr>\n<tr>\n<td>close</td>\n<td>关闭面板时触发</td>\n<td>-</td>\n</tr>\n<tr>\n<td>opened</td>\n<td>打开面板且动画结束后触发</td>\n<td>-</td>\n</tr>\n<tr>\n<td>closed</td>\n<td>关闭面板且动画结束后触发</td>\n<td>-</td>\n</tr>\n<tr>\n<td>click-overlay</td>\n<td>点击遮罩层时触发</td>\n<td><em>event: MouseEvent</em></td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="slots" tabindex="-1">Slots</h3>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>说明</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>title</td>\n<td>自定义顶部标题</td>\n</tr>\n<tr>\n<td>description</td>\n<td>自定义描述文字</td>\n</tr>\n<tr>\n<td>cancel</td>\n<td>自定义取消按钮内容</td>\n</tr>\n</tbody>\n</table>\n</div><div class="mi-doc-card"><h3 id="lei-xing-ding-yi" tabindex="-1">类型定义</h3>\n<p>组件导出以下类型定义：</p>\n<pre><code class="language-ts"><span class="hljs-keyword">import</span> <span class="hljs-keyword">type</span> {\n    <span class="hljs-title class_">ShareSheetProps</span>,\n    <span class="hljs-title class_">ShareSheetOption</span>,\n    <span class="hljs-title class_">ShareSheetOptions</span>,\n} <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;@miracle-web/ui&#x27;</span>;\n</code></pre>\n</div><h2 id="zhu-ti-ding-zhi" tabindex="-1">主题定制</h2>\n<div class="mi-doc-card"><h3 id="yang-shi-bian-liang" tabindex="-1">样式变量</h3>\n<p>组件提供了下列 CSS 变量，可用于自定义样式，使用方法请参考 <a href="#/zh-CN/config-provider" target="_blank">ConfigProvider 组件</a>。</p>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>默认值</th>\n<th>描述</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>--mi-share-sheet-header-padding</td>\n<td><em>var(--mi-padding-sm) var(--mi-padding-md) var(--mi-padding-base)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-title-color</td>\n<td><em>var(--mi-text-color)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-title-font-size</td>\n<td><em>var(--mi-font-size-md)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-title-line-height</td>\n<td><em>var(--mi-line-height-md)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-description-color</td>\n<td><em>var(--mi-text-color-2)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-description-font-size</td>\n<td><em>var(--mi-font-size-sm)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-description-line-height</td>\n<td><em>16px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-icon-size</td>\n<td><em>48px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-option-name-color</td>\n<td><em>var(--mi-gray-7)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-option-name-font-size</td>\n<td><em>var(--mi-font-size-sm)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-option-description-color</td>\n<td><em>var(--mi-text-color-3)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-option-description-font-size</td>\n<td><em>var(--mi-font-size-sm)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-cancel-button-font-size</td>\n<td><em>var(--mi-font-size-lg)</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-cancel-button-height</td>\n<td><em>48px</em></td>\n<td>-</td>\n</tr>\n<tr>\n<td>--mi-share-sheet-cancel-button-background</td>\n<td><em>var(--mi-background-2)</em></td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n</div><h2 id="chang-jian-wen-ti" tabindex="-1">常见问题</h2>\n<div class="mi-doc-card"><h3 id="ru-he-shi-xian-fen-xiang-luo-ji" tabindex="-1">如何实现分享逻辑？</h3>\n<p>在不同的 App 或浏览器中，存在各式各样的分享接口或分享方式，因此 ShareSheet 组件不提供具体的分享逻辑，需要开发者根据业务场景自行实现。</p>\n<h4 id="wei-xin-nei-fen-xiang" tabindex="-1">微信内分享</h4>\n<p>由于微信未提供分享相关的 API，需要引导用户点击右上角进行分享。</p>\n<h4 id="app-nei-fen-xiang" tabindex="-1">App 内分享</h4>\n<p>可以通过 JSBridge 调用原生应用的 SDK 进行分享。</p>\n<h4 id="fen-xiang-hai-bao-huo-er-wei-ma" tabindex="-1">分享海报或二维码</h4>\n<p>可以通过 <a href="#/zh-CN/popup" target="_blank">Popup</a> 组件以弹层的形式展示图片，然后引导用户保存图片进行分享。</p>\n</div>'},null,8,e))}}}]);